import Note from "./models/Note";
import User from "./microservices/auth/models/user";

export default (io) => {
  io.on("connection", (socket) => {
    // console.log(socket.handshake.url);
    console.log("nuevo cliente connectado:", socket.id);

    // Send all messages to the client
    const emitNotes = async () => {
      const notes = await Note.find();
      socket.emit("server:loadnotes", notes);
      // al momento de eliminar solo eliminar a la pantalla que esta realizo la ProcessingInstruction
      // para elimainar para todas las pantallas deben cambiar el socket.emit por io.emit
    };
    emitNotes();

    socket.on("client:newnote", async (data) => {
      const newNote = new Note(data);
      const savedNote = await newNote.save();
      io.emit("server:newnote", savedNote);
    });

    socket.on("client:deletenote", async (noteId) => {
      await Note.findByIdAndDelete(noteId);
      emitNotes();
    });

    socket.on("client:getnote", async (noteId) => {
      const note = await Note.findById(noteId);
      socket.emit("server:selectednote", note);
    });

    socket.on("client:updatenote", async (updatedNote) => {
      await Note.findByIdAndUpdate(updatedNote._id, {
        title: updatedNote.title,
        description: updatedNote.description,
      });
      emitNotes();
    });
  });
};

